column8:
密着仕様の天ふたと小径(約0.5mm)の通気孔により、コバエの侵入を抑制します。また、マットの乾燥を防止し、湿度を保持。ケース内の臭いや昆虫のオシッコなどを外側へもらしません。天ふたは一般のプラケースに比べると高さがあり、内部空間(高さ)に余裕ができ、背の高い木の設置などケース内部のディスプレーに自由度がアップ！クワガタのアゴがフタの溝の隙間にはさまって取れなくなる事故も防げますし、両サイドの確実固定ロックにより、力の強い外国産カブトムシ等の逃走も防止します。今までにない快適新機能満載のプラケースです。<BR><BR>サイズ：W420×D265×H328mm<BR><BR>メーカー：サンコー<!-- 帯バナー(RMSは共通説明文大に入ってる)-->

